def longest_common_subsequence(str1, str2): 
    m = len(str1) 
    n = len(str2) 

    # create a matrix of size m+1 x n+1 
    # filled with -1 except for the diagonals 
    L = [[-1 for x in range(n+1)] for x in range(m+1)] 

    # initialize the matrix 
    for i in range(1, m+1): 
        for j in range(1, n+1): 
            if str1[i-1] == str2[j-1]: 
                L[i][j] = L[i-1][j-1]+1
            else: 
                L[i][j] = -1

    # find the longest common subsequence 
    lcs = 1
    for i in range(m+1): 
        for j in range(n+1): 
            if L[i][j] == -1: 
                break
            lcs = max(lcs, L[i][j]) 

    return lcs

